import React from "react";
import { AppBar, Box, Toolbar } from "@mui/material";
import "./Navbar.css";

const Navbar = () => {
  return (
    <div
      className="navbar"
      style={{
        height: "20vh",
        backgroundColor: "black",
      }}
    >
      <button>HOME</button>
      <button>CONSULTS</button>
      <button>PROFILE</button>
      <button>LOG OUT</button>
    </div>
  );
};

export default Navbar;
